" У Малыша стало иссякать терпение, и, когда дядя Юлиус гостил у них в прошлый раз, он нарисовал его портрет в своем альбоме, а под рисунком написал: «Болван». Дядя Юлиус случайно увидел этот рисунок и сказал: «Плохо ты нарисовал лошадь».",
